import React, { useState } from "react";
import { motion } from "framer-motion";

export default function App() {
  const [url, setUrl] = useState("");
  const [loading, setLoading] = useState(false);
  const [msg, setMsg] = useState("");

  const handleDownload = async (e) => {
    e.preventDefault();
    if (!url.trim()) {
      setMsg("Please enter a YouTube URL.");
      return;
    }
    setMsg("");
    setLoading(true);

    try {
      const res = await fetch(`/api/stream?url=${encodeURIComponent(url)}`);
      if (!res.ok) throw new Error(`HTTP error! status: ${res.status}`);

      const blob = await res.blob();
      const disposition = res.headers.get("content-disposition") || "";
      const match = /filename="?([^"]+)"?/.exec(disposition);
      const filename = match && match[1] ? match[1] : "video.mp4";

      const a = document.createElement("a");
      a.href = URL.createObjectURL(blob);
      a.download = filename;
      document.body.appendChild(a);
      a.click();
      a.remove();
      URL.revokeObjectURL(a.href);
      setMsg("Download started ✔️");
    } catch (err) {
      console.error(err);
      setMsg("Download failed — check the URL and backend connection.");
    } finally {
      setLoading(false);
    }
  };

  const handlePaste = async () => {
    try {
      const text = await navigator.clipboard.readText();
      if (text) {
        setUrl(text);
        setMsg("");
      }
    } catch (err) {
      console.error("Failed to read clipboard:", err);
      setMsg("Unable to access clipboard. Please paste manually.");
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center p-4 bg-black">
      <motion.div
        className="w-full max-w-lg"
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
      >
        {/* Header */}
        <div className="text-center mb-8">
          <h1 className="text-4xl font-bold text-white mb-2">
            <span className="text-red-600">Me</span>Tube
          </h1>
          <p className="text-gray-400 text-sm">Download YouTube videos</p>
        </div>

        {/* Main Card */}
        <div className="bg-[#0a0a0a] border border-gray-800 rounded-xl p-6 shadow-xl">
          {/* Input with Paste Button */}
          <div className="relative mb-4">
            <input
              type="text"
              value={url}
              onChange={(e) => setUrl(e.target.value)}
              placeholder="Paste YouTube URL here..."
              disabled={loading}
              className="w-full bg-[#111] border border-gray-700 rounded-lg px-4 py-3 pr-12 text-white placeholder-gray-500 focus:border-red-600 focus:ring-1 focus:ring-red-600 outline-none transition-all text-sm"
            />
            <button
              type="button"
              onClick={handlePaste}
              disabled={loading}
              className="absolute right-2 top-1/2 -translate-y-1/2 px-3 py-1.5 bg-red-600 hover:bg-red-700 text-white text-xs font-medium rounded-md transition-colors disabled:opacity-50 disabled:cursor-not-allowed"
            >
              Paste
            </button>
          </div>

          {/* Download Button */}
          <button
            type="button"
            onClick={handleDownload}
            disabled={loading || !url.trim()}
            className="w-full bg-red-600 hover:bg-red-700 text-white font-medium py-3 rounded-lg transition-colors disabled:bg-gray-700 disabled:cursor-not-allowed disabled:opacity-50 mb-4"
          >
            {loading ? (
              <span className="flex items-center justify-center gap-2">
                <svg className="w-4 h-4 animate-spin" viewBox="0 0 24 24" fill="none">
                  <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
                  <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
                </svg>
                Downloading...
              </span>
            ) : (
              "Download"
            )}
          </button>

          {/* Message */}
          {msg && (
            <div
              className={`text-xs text-center py-2 px-3 rounded-md ${
                msg.includes("✔️")
                  ? "bg-green-900/30 text-green-400 border border-green-800"
                  : msg.includes("failed")
                  ? "bg-red-900/30 text-red-400 border border-red-800"
                  : "bg-blue-900/30 text-blue-400 border border-blue-800"
              }`}
            >
              {msg}
            </div>
          )}
        </div>

        {/* Footer */}
        <div className="text-center mt-6 text-gray-500 text-xs">
          Made by <span className="text-red-600 font-medium">antiz</span>
        </div>
      </motion.div>
    </div>
  );
}
